import React from 'react';
import atomicLogo from './atomicLogo.png'
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={atomicLogo} alt='logo'/>
        <h1>Elizabeth Porter</h1>
        <p>Full Stack Web Developer</p>
      </header>
    </div>
  );
}

export default App;
